// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import { ChakraProvider } from "@chakra-ui/react";
import App from './App';
import './index.css';

ReactDOM.render(

    <ChakraProvider>
      <App />
    </ChakraProvider>,

  document.getElementById('root')
);
